Tripp Research
Custom Colt Mark IV Series 80 Officer’s Model
Limited Edition
1 of 3
$2200.00
This an all-stainless (slide and frame) Officer-sized Colt Mark IV Series 80 1911 in .45acp.  The original owner had a set of Colt 1911’s (Government, Commander, and Officer) that he sent to Tripp Research to be completely customized exactly alike.  All three were:
•	Custom milled features: 
o	Snake skin fore-grip, carry bevel job, 45 degree chamfer beveled slide bottom, flattened and serrated slide top, flattened and smoothed trigger guard, and serrated slide rear.
•	Tuned;
•	Refinished in black Tripp Research Cobra Coat;
•	Fit with a hard chromed (Tripp Cobra Chrome) steel match barrel and barrel bushing; 
•	Heinie low-profile carry sights;
•	Beavertail safety;
•	Aluminum STI trigger with a 4.25 lb pull; and  
•	It also has the Cylinder & Slide Safety Fast Shooting (SFS) system with RDIH slide stop and safety controls.
This 1911 was returned to Tripp Research to have the Tripp Research Logo engraved on the slide. It is the only one of the three 1911’s with this feature.
